import { Component } from '@angular/core';

@Component({
  selector: 'app-nav',
  templateUrl: './nav.component.html',
  styleUrls: ['./nav.component.scss']
})
export class NavComponent {

}
<nav>
  <ol class="flex flex gap-10 justify-end">
    <li>LATEST</li>
    <li>SEARCH</li>
    <li>YEAR</li>
  </ol>
</nav>
